import React from 'react';
import styled from 'styled-components';

const LifeCell = styled.div`
  border: .5px solid black;
  width: 9px;
  height: 9px;
  background-color : ${props => {
    const isAlive = props.isAlive ;
    if(isAlive === true){
      return 'green';
    } else {
      return 'black';
    }
  }};
`;

/*
const test = props.isAlive && props.data.test;

  if (test === 'A' || test === 'B') {
    return 'yellow';
  } else if (test === 'C') {
    return 'green';
  } else {
    return 'blue';
  }
*/

const Cell = props => {
  return(
    <LifeCell />
  );
}

export default Cell;
